//Another example using DOWHILE loop
package practice;
public class EampleTwoDoWhile {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 20;

	      do {
	    	  System.out.print("value of x : " + x );
	          x++;
	          System.out.print("\n");
	          }while( x < 20 );

	}

}
